/** @format */

import React from "react";

class Grid extends React.Component {
  constructor(props) {
    super(props);
    console.log(props);
  }

  render() {
    return (
      <div id="grid">
        {this.props.repos.map(({ name, owner, stargazers_count, html_url }) => (
          <li key={name} id="main-li">
            <ul>
              <li>
                <a href={html_url}>{name}</a>
              </li>
              <li>@{owner.login}</li>
              <li>{stargazers_count}stars</li>
            </ul>
          </li>
        ))}
      </div>
    );
  }
}
export default Grid;
